func testRecipeToManyRemoveOpRecipeSectionIngredients(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a Recipe
	var b, c, d, e RecipeSectionIngredient

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, recipeDBTypes, false, strmangle.SetComplement(recipePrimaryKeyColumns, recipeColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*RecipeSectionIngredient{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, recipeSectionIngredientDBTypes, false, strmangle.SetComplement(recipeSectionIngredientPrimaryKeyColumns, recipeSectionIngredientColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	err = a.AddRecipeSectionIngredients(ctx, tx, true, foreigners...)
	if err != nil {
		t.Fatal(err)
	}

	count, err := a.RecipeSectionIngredients().Count(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 4 {
		t.Error("count was wrong:", count)
	}

	err = a.RemoveRecipeSectionIngredients(ctx, tx, foreigners[:2]...)
	if err != nil {
		t.Fatal(err)
	}

	count, err = a.RecipeSectionIngredients().Count(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 2 {
		t.Error("count was wrong:", count)
	}

	if !queries.IsValuerNil(b.Recipe) {
		t.Error("want b's foreign key value to be nil")
	}
	if !queries.IsValuerNil(c.Recipe) {
		t.Error("want c's foreign key value to be nil")
	}

	if b.R.RecipeSectionIngredientRecipe != nil {
		t.Error("relationship was not removed properly from the foreign struct")
	}
	if c.R.RecipeSectionIngredientRecipe != nil {
		t.Error("relationship was not removed properly from the foreign struct")
	}
	if d.R.RecipeSectionIngredientRecipe != &a {
		t.Error("relationship to a should have been preserved")
	}
	if e.R.RecipeSectionIngredientRecipe != &a {
		t.Error("relationship to a should have been preserved")
	}

	if len(a.R.RecipeSectionIngredients) != 2 {
		t.Error("should have preserved two relationships")
	}

	// Removal doesn't do a stable deletion for performance so we have to flip the order
	if a.R.RecipeSectionIngredients[1] != &d {
		t.Error("relationship to d should have been preserved")
	}
	if a.R.RecipeSectionIngredients[0] != &e {
		t.Error("relationship to e should have been preserved")
	}
}

